import React, { useState } from 'react';
import { useNavigate  } from 'react-router-dom';
import axios from 'axios';

const Register = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const history = useNavigate();

    const handleRegister = async () => {
        try {
            const response = await axios.post('/api/users/register', { username, password });
            console.log('Registered user:', response.data);
            // Dodaj odpowiednią obsługę sukcesu (np. przekierowanie na stronę logowania)
            history.push('/login');
        } catch (error) {
            console.error('Error during registration:', error);
            // Dodaj odpowiednią obsługę błędów (np. wyświetlanie komunikatu)
        }
    };

    return (
        <div>
            <h2>Rejestracja</h2>
            <label>Username: <input type="text" onChange={(e) => setUsername(e.target.value)} /></label>
            <label>Password: <input type="password" onChange={(e) => setPassword(e.target.value)} /></label>
            <button onClick={handleRegister}>Zarejestruj</button>
        </div>
    );
};

export default Register;
